<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
        <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@4.0.0/dist/css/bootstrap.min.css" integrity="sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm" crossorigin="anonymous">
        <link rel="preconnect" href="https://fonts.googleapis.com">
        <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
        <link href="https://fonts.googleapis.com/css2?family=Poppins&display=swap" rel="stylesheet">
        <title>Attendance</title>
    </head>
    <style type="text/css">
        *{
            font-family: 'Poppins';
        }
        .divv{
            width: 40vw;
        }
        .divv .input, select{
            margin-bottom: 2vh;
        }
        .divv span{
            font-size: 18px;
        }
        .input, select{
            width: 100%;
            height: 5vh;
            min-height: 40px;
            padding-left: 10px;
            padding-right: 10px;
        }
        .input:focus, select:focus{
            box-shadow: none;
            outline: 2px black;
        }
        @media (max-width: 767px) {
            .input{
                width: 80vw;
                height: 5vh;
            }
            .divv{
                width: auto;
            }
        }
        .btn:focus{
            box-shadow: none;
        }
        .btn{
            margin-top: 2vh;
            border-width: 1px;
            border-color: black;
        }
        .btn:hover{
            background-color: black;
            color: white;
        }
        #check{
            height: 14px;
            width: 14px;
            margin-right: 20px;
        }
        label{
            font-size: 18px;
            width: 100%;
            background-color: #f0f0f0;
            padding: 2vh;
        }
        #snackbar {
          visibility: hidden;
          min-width: 250px;
          margin-left: -125px;
          background-color: #333;
          color: #fff;
          text-align: center;
          border-radius: 2px;
          padding: 16px;
          position: fixed;
          z-index: 1;
          left: 50%;
          bottom: 30px;
        }

        #snackbar.show {
          visibility: visible;
          -webkit-animation: fadein 0.5s, fadeout 0.5s 2.5s;
          animation: fadein 0.5s, fadeout 0.5s 2.5s;
        }
        @-webkit-keyframes fadein {
          from {bottom: 0; opacity: 0;}
          to {bottom: 30px; opacity: 1;}
        }

        @keyframes fadein {
          from {bottom: 0; opacity: 0;}
          to {bottom: 30px; opacity: 1;}
        }

        @-webkit-keyframes fadeout {
          from {bottom: 30px; opacity: 1;}
          to {bottom: 0; opacity: 0;}
        }

        @keyframes fadeout {
          from {bottom: 30px; opacity: 1;}
          to {bottom: 0; opacity: 0;}
        }
    </style>
    <body onload="load()">
        <div class="container">
            <div class="row">
              <div class="col d-flex justify-content-center align-items-center" style="height: 100vh;">
                <div class="divv">
                    <div class="col text-center">
                        <h2>Data Form</h2>
                    </div>
                    <div class="col text-left">
                        <span>Date</span>
                    </div>
                    <div class="col text-center">
                        <input class="input" type="date" id="date">
                    </div>
                    <div class="col text-left">
                        <span>Subject</span>
                    </div>
                    <div class="col text-center">
                        <input class="input" type="text" id="subs">
                    </div>
                    <div class="col text-left">
                        <span>Group no.</span>
                    </div>
                    <div class="col text-center">
                        <select id="groups" onchange="load_names()"><option style="display: none;"></option></select>
                    </div>
                    <div class="col text-left" id="names"></div>
                    <div class="col text-left">
                        <span>P sant</span>
                    </div>
                    <div class="col text-center">
                        <input class="input" type="Text" id="psant">
                    </div>
                    <div class="col text-center">
                        <input class="input" type="submit" class="btn" onclick="send_data()">
                    </div>
                    <div id="snackbar">Success!</div>
                </div>
            </div>
        </div>
    </body>
